import React from 'react';




const Users = () => {
    return (
        <>
            <table className="table table-striped">
                <thead className="thead-dark">
                    <tr>
                        <th>Firstname</th>
                        <th>Lastname</th>
                        <th>Email</th>
                    </tr>
                </thead>
                <tbody>
                    {

                        Object.entries(userDetails).map((val, ind) => {
                            return (
                                <tr key={ind}>
                                    <td>{val[1].name}</td>
                                    <td>{val[1].email}</td>
                                    <td>{val[1].subject}</td>
                                </tr>
                            )

                        })



                    }
                    <tr>
                        <td>Rakesh</td>
                        <td>dadlsad</td>
                        <td>dsadsadasd</td>
                    </tr>
                </tbody>
            </table>
        </>
    )
}

export default Users
